INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1585, 8130, 'Palbociclib', 'Administration with food may enhance the oral bioavailability of palbociclib in some patients and reduce the intersubject variability of palbociclib exposure.  According to the product labeling, palbociclib absorption and exposure were very low in approximately 13% of the population when taken in the fasted state.  Food intake increased the palbociclib exposure in this small subset of the population, but did not alter palbociclib exposure in the rest of the population to a clinically relevant extent.  Compared to palbociclib given under overnight fasted conditions, the population average palbociclib peak plasma concentration (Cmax) and systemic exposure (AUC) increased by 38% and 21%, respectively, when given with high-fat, high-calorie food (approximately 800 to 1000 calories; 150, 250, and 500 to 600 calories from protein, carbohydrate and fat, respectively).', 'high-fat foods', 'Moderate', '', 'DDInter', 0, X'789c4dcdc11584300845d1567e05538b2d6042148d9043606c5f972edee2aede4221ac313177cb5e11743206f5d58a942e2b6e891dcdac82f4ed6f52514c675e23c414d6b0390d6e9e1230ffea48298c9a2eba219c29aef7f57b00069b2bfd', NULL, X'');
